// Fonction pour charger les Lookup country, event type, language
def loadLookUp(strFileName: String,strName: String,strRep: String)   = {
   val lkupRDD = sc.textFile(strRep + "CAMEO." + strFileName+ ".txt").mapPartitionsWithIndex {
     (idx, iter) => if (idx == 0) iter.drop(1) else iter 
   } 
   //val cachedLkup = lkupRDD.cache()
   if (strName=="Lkup_Country") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Country(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Evt_Type") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Evt_Type(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Language") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Language(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Act_Type") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Act_Type(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Quad_Code") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Quad_Code(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Act_Country") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Act_Country(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Act_Ethnic") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Act_Ethnic(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Act_Group") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Act_Group(c(0),c(1))).toDS.createOrReplaceTempView(strName)
   if (strName=="Lkup_Act_Religion") lkupRDD.map(_.split("\t")).filter(_.length==2).map(c=> Lkup_Act_Religion(c(0),c(1))).toDS.createOrReplaceTempView(strName)
}

// Fonction pour charger la lookup Domain
def loadLookUpDomain(strFileName: String,strName: String,strRep: String)   = {
   val lkupRDD = sc.textFile(strRep + "CAMEO." + strFileName+ ".txt").mapPartitionsWithIndex {
     (idx, iter) => if (idx == 0) iter.drop(1) else iter 
